using namespace std;
 
struct User{
    string login;
    string password;
    bool system;
 
    bool operator==(const User& other) const {
        return login == other.login && password == other.password;
    }
};
 
int main(){
    ios::sync_with_stdio(false);
    cin.tie(0);
 
    vector<User> user;
    string command, login, password;
    bool system;
    while (cin >> command){
        if (command == "login"){
            cin >> login >> password;
 
            bool already_logged_in = false, login_in = false;
            int64_t index = -1;
            for (int i = 0; i < user.size(); i++){
                if (user[i].login == login){
                    login_in = true;
                    index = i;
                    break;
                }
            }
            if (login_in && user[index].password == password){
                if (user[index].system == true){
                    cout << "already logged in" << endl;
                }
                else{
                    cout << "logged in" << endl;
                    user[index].system = true;
                }
            }
            else{
                cout << "wrong account info" << endl;
            }
        }
        else if (command == "register"){
            cin >> login >> password;
 
            bool login_in = false;
            for (int i = 0; i < user.size(); i++){
                if (user[i].login == login){
                    login_in = true;
                    break;
                }
            }
 
            if (login_in){
                cout << "login already in use" << endl;
            }
            else{
                User new_user{login, password, false};
                user.push_back(new_user);
                cout << "account created" << endl;
            }    
        }
        else if (command == "logout"){
            cin >> login;
 
            bool login_in = false;
            int64_t index = -1;
            for (int i = 0; i < user.size(); i++){
                if (user[i].login == login){
                    login_in = true;
                    index = i;
                    break;
                }
            }
            if (login_in){
                if (user[index].system == true){
                    cout << "logged out" << endl;
                    user[index].system = false;
                }
                else{
                    cout << "incorrect operation" << endl;
                }
            }
            else{
                cout << "incorrect operation" << endl;
            }
        }
    }
 
    return 0;
}

function createPdfFromRange(){

  var spreadsheetID = "here-your-spreadsheet-id";
  
  //Select the working sheet that you will convert to PDF
  var workingSheet = SpreadsheetApp.openById(spreadsheetID).getSheetByName("Sheet1");

  //Set the default range to whatever you want
  var range = range ? range : "A2:E35";

 /*
 The exportUrl variable is the most relevant part, how to format the range you selected from the working sheet and converted to a full page PDF that you can print later 
 */
 
  var sheetParam = "&gid=" + workingSheet.getSheetId();

  var exportUrl = url.replace(/\/edit.*$/, '')
      + '/export?exportFormat=pdf&format=pdf'
      + '&size=a5'                      //A3/A4/A5/B4/B5/letter/tabloid/legal/statement/executive/folio
      + '&portrait=true'                //true= Potrait / false= Landscape
      + '&scale=2'                      //1= Normal 100% / 2= Fit to width / 3= Fit to height / 4= Fit to Page
      + '&top_margin=0.00'              //All four margins must be set!
      + '&bottom_margin=0.00'           //All four margins must be set!
      + '&left_margin=0.00'             //All four margins must be set!
      + '&right_margin=0.00'           //All four margins must be set!
      + '&gridlines=true'               //true/false
      + '&printnotes=false'             //true/false
      + '&pageorder=1'                  //1= Down, then over / 2= Over, then down
      + '&horizontal_alignment=CENTER'  //LEFT/CENTER/RIGHT
      + '&vertical_alignment=TOP'       //TOP/MIDDLE/BOTTOM
      + '&printtitle=false'             //true/false
      + '&sheetnames=false'             //true/false
      + '&fzr=false'                    //true/false
      + '&fzc=false'                    //true/false
      + '&attachment=false'
	  + '&range=' + range
      + sheetParam
      
    Logger.log('exportUrl=' + exportUrl);

  var params = {
    method: "GET",
    headers: { Authorization: "Bearer " + ScriptApp.getOAuthToken() },
    muteHttpExceptions: true
  };

  var response = UrlFetchApp.fetch(exportUrl, params);

  //Handle error 200
  if (response.getResponseCode() !== 200) {
    throw new Error("Error exporting sheet: " + response.getContentText());
  }

  
  //Give a name to your PDF file, this can be dynamic or fixed, I am using a date for this
  var fileName = "Generated PDF " + Utilities.formatDate(new Date(), "GMT-4", "MM/dd/yyyy");
  
  //This is the target folder ID where the creatd PDF's will be stored
  var folderId = "your-google-drive-folder-id-here";
    
  //Get the target folder by using the previous ID
  var folder = DriveApp.getFolderById(folderId);
  
  //Create the new PDF file from the blob and set a name
  var file = folder.createFile(response.getBlob().setName(fileName));
  
  //You can rename it later
  file.setName(fileName);
	
  //Check that the PDF file was created successfully
  Logger.log(file.getUrl());
  
  //Return the file URL or any other parameter that you may need in another function, this is optional
  return file.getUrl();
}

